import {StyleSheet} from 'react-native';
export default StyleSheet.create({
  icon: {
    width: 30,
    height: 30,
  },
  locationTrackingContainer: {
    height: 110,
    paddingLeft: 10,
    paddingRight: 10,
  },
  footer: {
    padding: 10,
  },
});
